CREATE TABLE IF NOT EXISTS public.prompts
(
    id uuid NOT NULL,
    "mandatoryQuestions" text COLLATE pg_catalog."default" NOT NULL,
    "medicalHistory" text COLLATE pg_catalog."default" NOT NULL,
    "predefinedTreatments" text COLLATE pg_catalog."default" NOT NULL,
    "createdAt" timestamp with time zone NOT NULL,
    "updatedAt" timestamp with time zone NOT NULL,
    "deletedAt" timestamp with time zone,
    "patientId" uuid NOT NULL,
    CONSTRAINT prompts_pkey PRIMARY KEY (id)
);

CREATE TABLE IF NOT EXISTS public.symptoms
(
    id uuid NOT NULL,
    name character varying(255) COLLATE pg_catalog."default" NOT NULL,
    description text COLLATE pg_catalog."default" NOT NULL,
    severity enum_symptoms_severity NOT NULL,
    "createdAt" timestamp with time zone NOT NULL,
    "updatedAt" timestamp with time zone NOT NULL,
    "deletedAt" timestamp with time zone,
    CONSTRAINT symptoms_pkey PRIMARY KEY (id)
);

